import React from 'react';
import TaskToggle from "../task-toogle/task-toggle";
import TaskButton from "../task-button/task-button";
import TaskLabel from "../task-label/task-label";
import TaskListItem from "../task-list-item/task-list-item";


const Task = ({mainClass, className, id, testFun}) => {
    return <div className={className}  >
                <TaskToggle id={id} testFun={testFun}  mainClass={mainClass} className="toggle" type="checkbox"/>
                <TaskLabel     mainClass={mainClass}/>
                <TaskButton testFun={testFun} id={id} className='icon icon-edit'/>
                <TaskButton testFun={testFun} id={id} className='icon icon-destroy'/>
        </div>
}

export default Task;
